  FAIRWEATHER during project OPR-O190-FA-16 in the Coastal Waters of SE Alaska from
  2016-05-08 to 2016-06-15. These data include CONDUCTIVITY, HYDROSTATIC PRESSURE,
  SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD. These data were collected and submitted by the
  NOAA Office of Coast Survey in support of hydrographic multibeam surveys to meet
